import React from 'react';
import PropTypes from 'prop-types';
import '@vkontakte/vkui/dist/vkui.css';
import { Panel, PanelHeader, PanelHeaderBack, Button, FixedLayout } from '@vkontakte/vkui';

import cinema_db from './dbs/cinema.json'

fetch(cinema_db).then(cinema_db => console.log(cinema_db))

const Cinema = props => (
    
	<Panel id={props.id}>
		<FixedLayout>
			<PanelHeader
				left={<PanelHeaderBack onClick={props.go} data-to="home"/>}
			>чё посмотреть?
			</PanelHeader>
			<Button stretched size="l">скажи</Button>
		</FixedLayout>
	</Panel>
);

Cinema.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
};

export default Cinema;
